import React, { Component } from "react";


class TeamMember extends Component {
        render(){
    return(

            <div className="col-md-4 col-sm-6 ">
            <div className="card">
                 <div className="card-header">
                      < img style={{maxWidth : '100%'}} src={this.props.img} alt=''/>
                 </div>

                 <div className="card-body"
                 style={{backgroundColor : this.props.website ? 'white' : 'black'}}>
                    <h2>{this.state.name}</h2>
                    <h5>{this.state.position}</h5>
                    <div>{this.state.phone}</div>
                    <div>{this.state.email ? this.state.email : <span  style={{backgroundColor :'red'}}> pas de compt mail </span>}</div>
                    <div>{this.state.website  }</div>
                 </div>
            </div>

        </div>

    )
}
}


export default TeamMember;
